import React from "react";
import Card from "./components/Card";

function HomePage() {
  return (
    <div>
      <h1>My First React App</h1>
      <Card id={1} imgSrc={"http://localhost:3001/assets/image.jpg"} />
      <Card id={2} imgSrc={"http://localhost:3001/assets/image2.jpg"} />
    </div>
  );
}

export default HomePage;
